// src/pages/EditCarPage.js
import React from 'react';
import CarForm from '../components/CarForm';

function EditCarPage() {
  return (
    <div>
      <h1>Edit Car</h1>
      <CarForm isEdit={true} />
    </div>
  );
}

export default EditCarPage;
